const e=JSON.parse('{"key":"v-52650e35","path":"/essay.html","title":"경험정리 소개","lang":"ko-KR","frontmatter":{"title":"경험정리 소개","description":"경험정리 소개 경험정리에서는 10년간 20개 이상의 프로젝트에서 경험한 지식과 생각을 담았습니다. 서비스를 개발하면서 뭔가 명확한 기준을 세워서 개발하는 것을 좋아합니다. 내 스스로가 왜 이렇게 했는지 납득할 수 있어야 하고 동료들에게 왜 이렇게 했는지 설명하기 위해서 명확한 기준을 세우는 것을 중요하다고 생각합니다. 개발자로 있으면서 경험은 되게 중요합니다. 책이나 사이트의 글을 보고 지식을 쌓은 것은 단순히 정보에 불과합니다. 그 정보를 서비스에 적용하거나 동료들과 논의해서 새로운 정보를 만들어 본인의 경험을 만드는것이 더욱 좋습니다. 그리고 경험은 머리속에서만 있으면 기억에 의존하기때문에 잘못된 기억을 되집기도 합니다.","head":[["meta",{"property":"og:url","content":"https://the-next-web-research-lab.github.io/essay.html"}],["meta",{"property":"og:site_name","content":"더넥스트웹리서치랩"}],["meta",{"property":"og:title","content":"경험정리 소개"}],["meta",{"property":"og:description","content":"경험정리 소개 경험정리에서는 10년간 20개 이상의 프로젝트에서 경험한 지식과 생각을 담았습니다. 서비스를 개발하면서 뭔가 명확한 기준을 세워서 개발하는 것을 좋아합니다. 내 스스로가 왜 이렇게 했는지 납득할 수 있어야 하고 동료들에게 왜 이렇게 했는지 설명하기 위해서 명확한 기준을 세우는 것을 중요하다고 생각합니다. 개발자로 있으면서 경험은 되게 중요합니다. 책이나 사이트의 글을 보고 지식을 쌓은 것은 단순히 정보에 불과합니다. 그 정보를 서비스에 적용하거나 동료들과 논의해서 새로운 정보를 만들어 본인의 경험을 만드는것이 더욱 좋습니다. 그리고 경험은 머리속에서만 있으면 기억에 의존하기때문에 잘못된 기억을 되집기도 합니다."}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:image","content":"https://the-next-web-research-lab.github.io/images/og_image.png"}],["meta",{"property":"og:locale","content":"ko-KR"}],["meta",{"property":"og:updated_time","content":"2023-08-02T13:58:54.000Z"}],["meta",{"name":"twitter:card","content":"summary_large_image"}],["meta",{"name":"twitter:image:alt","content":"경험정리 소개"}],["meta",{"property":"article:modified_time","content":"2023-08-02T13:58:54.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"경험정리 소개\\",\\"image\\":[\\"https://the-next-web-research-lab.github.io/images/og_image.png\\"],\\"dateModified\\":\\"2023-08-02T13:58:54.000Z\\",\\"author\\":[]}"]]},"headers":[],"git":{"createdTime":1687165152000,"updatedTime":1690984734000,"contributors":[{"name":"ChoDragon9","email":"04whdydrn30@gmail.com","commits":6},{"name":"Yongku cho","email":"04whdydrn30@gmail.com","commits":6}]},"readingTime":{"minutes":0.05,"words":14},"filePathRelative":"essay.md","localizedDate":"2023년 6월 19일","excerpt":"<h1> 경험정리 소개</h1>\\n<p>경험정리에서는 10년간 20개 이상의 프로젝트에서 경험한 지식과 생각을 담았습니다.</p>\\n<p>서비스를 개발하면서 뭔가 명확한 기준을 세워서 개발하는 것을 좋아합니다. 내 스스로가 왜 이렇게 했는지 납득할 수 있어야 하고 동료들에게 왜 이렇게 했는지 설명하기 위해서 명확한 기준을 세우는 것을 중요하다고 생각합니다.</p>\\n<p>개발자로 있으면서 경험은 되게 중요합니다. 책이나 사이트의 글을 보고 지식을 쌓은 것은 단순히 정보에 불과합니다. 그 정보를 서비스에 적용하거나 동료들과 논의해서 새로운 정보를 만들어 본인의 경험을 만드는것이 더욱 좋습니다. 그리고 경험은 머리속에서만 있으면 기억에 의존하기때문에 잘못된 기억을 되집기도 합니다.</p>","autoDesc":true}');export{e as data};
